          Being an Interaction Designer

        There’s more to being a designer than just the designing. we follow a number of techniques and approaches to become better designers.





          Stages of Interaction Design

        Our approach uses a mix of cognitive, strategic and practical processes which we’ve grouped into 5 iterative and looping stages.





          Interaction Design artefacts and documentation

        We use a variety of tools to help us create Interaction Design outputs depending on the purpose.





          Working as a team

        Adopting a collaborative and supportive team culture is essential for us to build and grow as a team to deliver our best work.




